column293:
랄라블라에 1902향수 파는데
피오니  &amp; 루바르브  진짜 향 특이한거 좋아하시면 추천드리빈다...
그냥... 어떤향이냐면.. 뿌리면.. 그냥.... 잔디밭에 코박은거같음... 진짜 장난안하고;;;
어렸을떄 잔디밭에서 놀다가 넘어졌을때 향임;
너무 너무 ㄷ잔디냄샌데.... 첫향날라가면 넘좋아욧

column278:
@e_poi_sarai_ 
싸:싸이비교주같은 녹그리 보고싶다
랄:랄라블라에서 무슨 틴트사셨는지도 묻고싶다

column306:
진짜 창렬...;;
비슷한 예시로는 랄라블라 교환•환불 정책도 있음..
세일기간에 할인하는 품목하고, 정가인 품목 동시에 구매하고, 며칠 후에 세일기간 끝나고 정가로 샀던 제품 교환받으려는데, 전체 취소하고 교환하는 과정에서 할인가 적용 안된다고 추가금 내라고 함;;

